import React, { useState } from 'react';
import DataWithAll from './DataWithAll';


const OurPlans = () =>{
    
const card = (val) =>{
    const style = {
        backgroundImage:val.reference,
        backgroundSize:'cover',
    }
    return(
        <>
        <div className="card" style={style}>
            <h1>{val.title}</h1>
            <p>No. Of Traks {val.treks}</p>
        </div>
        </>
    )
}


return(
<>
<h3>See Our Plans</h3>
<div className="plan">
{
    DataWithAll.map(card)
}
</div>
</> 
      )
}

export default OurPlans;
